//------------------------------------------------------------------------------
// Sticky Nav (adapted from happycog.com)
//------------------------------------------------------------------------------
var $fixedNav = $('.js-fixed-nav');
var siteHeaderTop = 20;

if ($fixedNav.size()) { // make sure it exists
	$(window).scroll(function () {
		if ($fixedNav.hasClass('js-fixed-nav--top') && $(window).scrollTop() > siteHeaderTop) {
			$fixedNav.addClass("js-fixed-nav--scrolling").removeClass('js-fixed-nav--top');
		}
		else if ($fixedNav.hasClass('js-fixed-nav--scrolling') && $(window).scrollTop() <= siteHeaderTop) {
			$fixedNav.removeClass("js-fixed-nav--scrolling").addClass('js-fixed-nav--top');
		}
	});
}

//------------------------------------------------------------------------------
// Scroll Activation
//
// This module makes a section "Active" when scrolling down
//
// Add .scroll-activation to the container
// Add (optional) .scroll-activation--keep-active to keep the section active once activated; otherwise,
//     the active will be removed after going back up.
// Add (optional) .scroll-activation--trigger to the element on the page which activates the section
//   Optional:
//     Add 'data-target="any-name"' on the target element and any element you'd like to set 'active'
//     Add 'data-scroll-position="top" to wait until scroll activator hits the top' (this makes room for sticky nav)
//
// Output
//   Adds 'active' class to when active
//------------------------------------------------------------------------------
var scrollActivate = function(scrollActivationItems) {
	var $window = $(window);
	scrollActivationItems.each(function() {
		if (!($(this).hasClass('js-scroll-activation--stop'))) {
			var $scrollItem = $(this);
			// scrollActivationTop: where the element starts on the entire page in px.
			var scrollActivationTop = $scrollItem.offset().top;
			var scrollOffset = 0;
			if ($scrollItem.attr('data-scroll-offset')) {
				scrollOffset += getScrollOffset($scrollItem.attr('data-scroll-offset'));
			}

			if ($scrollItem.data('scroll-position') === 'top') {
				var windowOffset = 0;

				// fixed header adjustments:
				var fixedHeaderHeight = $('.js-fixed-nav').height();
				scrollOffset = scrollOffset + fixedHeaderHeight;
			} else {
				var windowOffset = $window.height()
			}
			if (   $window.scrollTop() > (scrollActivationTop - windowOffset - scrollOffset) ) {
				$scrollItem.addClass('active');
				$('[data-target=' + $scrollItem.attr('data-target') + ']').addClass('active');
			} else if ( !($scrollItem.hasClass('js-scroll-activation--keep-active')) ) {
				$scrollItem.removeClass('active');
				$('[data-target=' + $scrollItem.attr('data-target') + ']').removeClass('active');
			}
		}
	});
}

function scrollActivation() {
	window.setTimeout(function() {
		var $window = $(window);
		$window.scroll(function () {
			scrollActivate(scrollActivationItems);
		});
	}, 500); // wait half a second for the page to load
}

var scrollActivationItems = $('.js-scroll-activation');
scrollActivation(scrollActivationItems);
scrollActivate(scrollActivationItems);


//------------------------------------------------------------------------------
// Animated Scroll
//
// Setup:
//   Add the 'animated-scroll' class to the element you'd like to animate the anchor tag's scroll
//
// Variables:
//   element: This is either the element on the page to get the position of
//   -OR-
//   element can be the numeric position to go to;
//   topPadding: any extra padding to add to the top of the animated scroll position.
//
//------------------------------------------------------------------------------

function animatedScroll(element, topPadding, dontRepeat) {
	var $viewport = $('html, body');

	// Stop the animation if the user scrolls. Defaults on .stop() should be fine
	$viewport.bind("scroll mousedown DOMMouseScroll mousewheel keyup", function(e){
		if ( e.which > 0 || e.type === "mousedown" || e.type === "mousewheel"){
			$viewport.stop().unbind('scroll mousedown DOMMouseScroll mousewheel keyup');
		}
	});

	topPadding = typeof topPadding === 'undefined' ? 0 : topPadding;
	var scrollOffset = 0;
	var href = $(element).attr('href');

	if (isNaN(element)) { // check if it's "not a number":
		var elementPosition = $(href).offset().top;
	} else {
		var elementPosition = element;
	}

	// if ($(this).attr('data-scroll-offset').length > 0) {
	//  scrollOffset = getScrollOffset($(this).attr('data-scroll-offset'));
	// }

	// Test for both "in-page-nav" AND "header-nav":
	var fixedHeaderHeight = 0;
	var wpadminbar = 0;
	if ( $('header.site-header').css('position') === 'fixed' ) {
		fixedHeaderHeight = $('header.site-header').height();
	}
	if ( $('#wpadminbar').css('position') === 'fixed' ) {
		wpadminbar = $('#wpadminbar').height();
	}

	scrollOffset = scrollOffset + fixedHeaderHeight + wpadminbar;
	scrollOffset = scrollOffset - 2; // subtract a single pixel to make sure it's in the activation zone
	$('html,body').animate({scrollTop:(elementPosition - scrollOffset - topPadding)}, 400, function() {
		// change the href on callback
		if (typeof href != 'undefined') {
			window.location.hash = href;
		}
		// check to see if the fixed nav has changed and if so, run the animated scroll again:
		if (($('header.site-header').height() != fixedHeaderHeight || $('#wpadminbar').height() != wpadminbar) && typeof dontRepeat === 'undefined') {
			animatedScroll(element, topPadding, 'dontrepeat');
		};
	});
}
$('.animated-scroll').on('click',function() {
	animatedScroll(this,80);
});

